import styled from "styled-components";

export const InputBox = styled.input`
  height: 20px;
  padding: 10px;
  margin: 20px 0;
  color: #fff;
  background: var(--primary);
  outline: none;
  border: 1px solid #fff;
  border-radius: 10px;

  font-family: 'Nunito', sans-serif;
  font-size: 16px;
`
